      quotes: ["It does not do to dwell on dreams and forget to live.", "It takes a great deal of bravery to stand up to our enemies, but just as much to stand up to our friends.", "To the well-organized mind, death is but the next great adventure.", "It is our choices, Harry, that show what we truly are, far more than our abilities.", "Happiness can be found even in the darkest of times if only one remembers to turn on the light.", "If you want to know what a mans like, take a good look at how he treats his inferiors, not his equals.", "Dark and difficult times lie ahead. Soon we must all face the choice between what is right and what is easy.", "Just because you have the emotional range of a teaspoon doesnt mean we all have.", "Weve all got both light and dark inside us. What matters is the part we choose to act on. Thats who we really are.", "Harry, suffering like this proves you are still a man! This pain is part of being human  the fact that you can feel pain like this is your greatest strength.", "Things we lose have a way of coming back to us in the end, if not always in the way we expect.", "It is the unknown we fear when we look upon death and darkness, nothing more.", "Of course it is happening inside your head, Harry, but why on earth should that mean that it is not real?", "Words are in my not-so-humble opinion, the most inexhaustible form of magic we have, capable both of inflicting injury and remedying it.", "After all this time? Always.", "No story lives unless someone wants to listen. The stories we love best do live in us forever. So whether you come back by page or by the big screen, Hogwarts will always be there to welcome you home.", "Of course it is happening inside your head, Harry, but why on Earth should that mean that it is not real?", "You're a wizard, Harry.", "We could all have been killed - or worse, expelled.", "Never trust anything that can think for itself if you can't see where it keeps its brain.", "Its wingardium leviOsa, not leviosAH.", "You sort of start thinking anythings possible if youve got enough nerve.", "I solemnly swear I am up to no good."]
